import React from "react";
import bgVideo from "../Images/About.mp4";
import "./css/videoBg.css";
import SocialMediaIcons from "./socialIcons";

function VideoBgSection() {
  const caseStudy = 21;
  const projects = 8;
  const rnd = 35;
  return (
    <React.Fragment>
      <div className="d-flex justify-content-center videoBg-div">
        <video src={bgVideo} autoPlay muted loop className="ms-auto"></video>
        <div className="text-on-video-head text-white">
          <h1>About Us</h1>
          <div className="d-flex my-5">
            <div className="text-center fs-2">
              <SocialMediaIcons sMedia="briefcase-fill " />
              <p>{caseStudy}</p>
            </div>
          </div>
        </div>
      </div>
    </React.Fragment>
  );
}

export default VideoBgSection;
